import React, { useState } from 'react';
import { Link } from 'react-router-dom';

// This is a placeholder. In a real app, fetch purchases from backend or context.
const PurchasesPage = () => {
  // Simulate purchased properties
  const [purchases, setPurchases] = useState([
    // Example: { id: '1', name: 'Test Property', location: 'New York', price: 100 }
  ]);

  return (
    <div className="container mx-auto max-w-2xl p-6 bg-white rounded shadow mt-8">
      <h1 className="text-2xl font-bold mb-4">My Purchases</h1>
      {purchases.length === 0 ? (
        <p className="text-gray-600">You have not bought any properties yet.</p>
      ) : (
        <ul className="divide-y">
          {purchases.map(p => (
            <li key={p.id} className="py-4 flex flex-col md:flex-row md:items-center md:justify-between">
              <div>
                <div className="font-semibold">{p.name}</div>
                <div className="text-gray-500 text-sm">{p.location}</div>
              </div>
              <div className="text-indigo-700 font-bold">${p.price}</div>
              <Link to={`/property/${p.id}`} className="text-blue-600 hover:underline ml-4">View</Link>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default PurchasesPage;
